import {Link, useNavigate} from 'react-router-dom'
function Header(){
    const navigate = useNavigate()
    console.log("Loading")
    return(
        <div>
            <Link to="/">Home</Link>
            <Link to="/login">Login</Link>
            <Link to="/user">User</Link>
            {/* <button onClick={()=>navigate("/login")}> Login </button> */}
        </div>
    )
}
export default Header
